import React from 'react'

function Card(props) {
    return (
        <>  
            <a href= {props.href}>
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src={props.src} />
            </Card>
            </a>
        </>
    )
}

export default Card
